slice::<impl [T]>::to_vec_in.doc:
Copies `self` into a new `Vec` with an allocator.

# Examples

```
#![feature(allocator_api)]

use std::alloc::System;

let s = [10, 40, 30];
let x = s.to_vec_in(System);
// Here, `s` and `x` can be modified independently.
```

